getLastChar:
abstract char getLastChar();

void addIdentifier(String identifier) {
  add(identifier);
}

append:
abstract void append(String str);

void appendBlockStart() {
  append("{");
}

void appendBlockEnd() {
  append("}");
}

appendBlockStart:
void appendBlockStart() {
  append("{");
}

void appendBlockEnd() {
  append("}");
}

beginBlock:
void beginBlock() {
  if (statementNeedsEnded) {
    append(";");
    maybeLineBreak();
  }
  appendBlockStart();

  endLine();
  statementNeedsEnded = false;
}

endBlock:
void endBlock(boolean shouldEndLine) {
  appendBlockEnd();
  if (shouldEndLine) {
    endLine();
  }
  statementNeedsEnded = false;
}

maybeEndStatement:
void maybeEndStatement() {
  // Add a ';' if we need to.
  if (statementNeedsEnded) {
    append(";");
    maybeLineBreak();
    endLine();
    statementNeedsEnded = false;
  }
  statementStarted = true;
}

endFunction:
void endFunction(boolean statementContext) {
  sawFunction = true;
  if (statementContext) {
    endLine();
  }
}

add:
void add(String newcode) {
  maybeEndStatement();

  if (newcode.length() == 0) {
    return;
  }

  char c = newcode.charAt(0);
  if ((isWordChar(c) || c == '\\') &&
      isWordChar(getLastChar())) {
    // need space to separate. This is not pretty printing.
    // For example: "return foo;"
    append(" ");
    // Do not allow a forward slash to appear after a DIV.
    // For example,
    // REGEXP DIV REGEXP
    // is valid and should print like
    // / // / /
  }

  append(newcode);
}

appendOp:
void appendOp(String op, boolean binOp) {
  append(op);
}

addOp:
void addOp(String op, boolean binOp) {
  maybeEndStatement();

  char first = op.charAt(0);
  char prev = getLastChar();

  if ((first == '+' || first == '-') && prev == first) {
    // This is not pretty printing. This is to prevent misparsing of
    // things like "x + ++y" or "x++ + ++y"
    append(" ");
  } else if (Character.isLetter(first) &&
             isWordChar(prev)) {
    // Make sure there is a space after e.g. instanceof , typeof
    append(" ");
  } else if (prev == '-' && first == '>') {
    // Make sure that we don't emit -->
    append(" ");
  }

  // Allow formating around the operator.
  appendOp(op, binOp);

  // Line breaking after an operator is always safe. Line breaking before an
  // operator on the other hand is not. We only line break after a bin op
  // because it looks strange.
  if (binOp) {
    maybeCutLine();
  }
}

addNumber:
void addNumber(double x) {
  // This is not pretty printing. This is to prevent misparsing of x- -4 as
  // x--4 (which is a syntax error).
  char prev = getLastChar();
  if (x < 0 && prev == '-') {
    add(" ");
  }

  if ((long) x == x && !isNegativeZero(x)) {
    long value = (long) x;
    long mantissa = value;
    int exp = 0;
    if (Math.abs(x) >= 100) {
      while (mantissa / 10 * Math.pow(10, exp + 1) == value) {
        mantissa /= 10;
        exp++;
      }
    }
    if (exp > 2) {
      add(Long.toString(mantissa) + "E" + Integer.toString(exp));
    } else {
      add(Long.toString(value));
    }
  } else {
    add(String.valueOf(x));
  }
}

isWordChar:
static boolean isWordChar(char ch) {
  return (ch == '_' ||
          ch == '$' ||
          Character.isLetterOrDigit(ch));
}

